import React, { Component } from "react";
import PageHelmet from "../component/common/Helmet";
import { FiPhone , FiMail , FiMapPin } from "react-icons/fi";
import GoogleMapReact from 'google-map-react';
import ContactTwo from "../elements/contact/ContactTwo";
import BrandTwo from "../elements/BrandTwo";
import ScrollToTop from 'react-scroll-up';
import { FiChevronUp } from "react-icons/fi";
import HeaderThree from "../component/header/HeaderThree";
import FooterTwo from "../component/footer/FooterTwo";
import Particles from 'react-particles-js';

const AnyReactComponent = ({ text }) => <div>{text}</div>;

class Contact extends Component{
    static defaultProps = {
        center: {
            lat: 59.95,
            lng: 30.33
        },
        zoom: 11
    };

    render(){
        return(



          <div className="slider-wrapper">

              <div className="slider-activation slider-creative-agency with-particles" id="home">
                  <div className="frame-layout__particles">
                    <Particles
                        params={{
                            "particles": {
                                "number": {
                                    "value": 100
                                },
                                "size": {
                                    "value": 4
                                }
                            },
                            "interactivity": {
                                "events": {
                                    "onhover": {
                                        "enable": true,
                                        "mode": "repulse"
                                    }
                                }
                            }
                        }}
                    />
                  </div>
                  <div>
                  {SlideList.map((value , index) => (
                      <div className="slide personal-portfolio-slider slider-paralax slider-style-3 d-flex align-items-center justify-content-center" key={index}>

                          <div className="container">
                              <div className="row">
                                  <div className="col-lg-12">
                                      <div className={`inner ${value.textPosition}`}>
                                          <h1 className="title">Hi, I’m Sean Goyel<br/>
                                          <TextLoop>
                                              <span> Developer.</span>
                                              <span> Student.</span>
                                              <span> Innovator.</span>
                                          </TextLoop>{" "}
                                          </h1>
                                          {value.description ? <p className="description">{value.description}</p> : ''}
                                          {value.buttonText ? <div className="slide-btn"><a className="rn-button-style--2 btn-primary-color" href={`${value.buttonLink}`}>{value.buttonText}</a></div> : ''}
                                      </div>
                                  </div>
                              </div>
                          </div>
                      </div>

                  ))}
                </div>
              </div>









          <div class="one-page active-dark">
            <React.Fragment>
                <PageHelmet pageTitle='Contact' />

                <HeaderThree homeLink="/" logo="symbol-dark" color="color-white"/>

                 {/* Start Breadcrump Area */}
                 <div className=" pb--190 active-dark "  data-black-overlay="6">
                    <div className="container">
                        <div className="row">
                            <div className="col-lg-12">
                                <div className="rn-page-title text-center pt--100">
                                    <h2 className="title theme-gradient">Lets get in touch!</h2>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                {/* End Breadcrump Area */}


                {/* Start Contact Top Area  */}
                <div className="rn-contact-top-area ptb--120 bg_color--5">
                    <div className="container">

                        <div className="row">
                            {/* Start Single Address  */}
                            <div className="col-lg-4 col-md-6 col-sm-6 col-12">
                                <div className="rn-address active-dark">
                                    <div className="icon">
                                        <FiPhone />
                                    </div>
                                    <div className="inner">
                                        <h4 className="title">Phone Number</h4>
                                        <h6 className="title" href="tel:+1 604 600 2148">604 - 600 - 2148</h6>
                                    </div>
                                </div>
                            </div>
                            {/* End Single Address  */}

                            {/* Start Single Address  */}
                            <div className="col-lg-4 col-md-6 col-sm-6 col-12 mt_mobile--50">
                                <div className="rn-address active-dark">
                                    <div className="icon">
                                        <FiMail />
                                    </div>
                                    <div className="inner">
                                        <h4 className="title">Email Address</h4>
                                        <h6 className="title" href="seangoyel@hotmail.com">seangoyel@hotmail.com</h6>
                                    </div>
                                </div>
                            </div>
                            {/* End Single Address  */}

                            {/* Start Single Address  */}
                            <div className="col-lg-4 col-md-6 col-sm-6 col-12 mt_md--50 mt_sm--50">
                                <div className="rn-address active-dark">
                                    <div className="icon">
                                        <FiMapPin />
                                    </div>
                                    <div className="inner">
                                        <h4 className="title">Location</h4>
                                        <h6 className="title">Vancouver BC, Canada</h6>
                                    </div>
                                </div>
                            </div>
                            {/* End Single Address  */}

                        </div>
                    </div>
                </div>
                {/* End Contact Top Area  */}



                <div class="lock-bottom">
                  <FooterTwo />
                </div>

            </React.Fragment>
          </div>
          </div>
        )
    }
}
export default Contact
